    toc3 = time.perf_counter()\n        perf[g//timeStep][0] = toc3 - tic3\n\n\n\nprint(\"pca, \", pca, flush=True)\nResults.append([pca.explained_variance_ , pca.singular_values_])\ntp = time.perf_counter()\nprint(\"Total time to Dask solution is \", tp-t)\n\npperf = pd.DataFrame(perf,columns=['generation', 'getdata', 'getdataq', 'computation'])\npdata = pd.DataFrame(Results,columns=[ 'his', 'bins'])\n\nwith open(\"perf.csv\", \"a\") as fperf:\n    pperf.to_csv(fperf, encoding='utf-8', index=False)\n    \nwith open(\"diag.csv\", \"a\") as fdiag:\n    pdata.to_csv(fdiag, encoding='utf-8', index=False)\n    \nC.Finalization()\n    \n\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"dimensions":"width"},"id":"1388","type":"WheelZoomTool"},{"attributes":{},"id":"1500","type":"UnionRenderers"},{"attributes":{"coordinates":null,"data_source":{"id":"1074"},"glyph":{"id":"1103"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1105"},"nonselection_glyph":null,"selection_glyph":null,"view":{"id":"1107"}},"id":"1106","type":"GlyphRenderer"},{"attributes":{"days":[1,8,15,22]},"id":"1465","type":"DaysTicker"},{"attributes":{"below":[{"id":"1084"}],"center":[{"id":"1087"},{"id":"1091"}],"left":[{"id":"1088"}],"renderers":[{"id":"1106"}],"sizing_mode":"stretch_both","title":{"id":"1415"},"toolbar":{"id":"1097"},"x_range":{"id":"1076"},"x_scale":{"id":"1080"},"y_range":{"id":"1078"},"y_scale":{"id":"1082"}},"id":"1075","subtype":"Figure","type":"Plot"},{"attributes":{},"id":"1076","type":"DataRange1d"},{"attributes":{"child":{"id":"1401"},"title":"Summary"},"id":"1402","type":"Panel"},{"attributes":{"below":[{"id":"1259"}],"center":[{"id":"1262"},{"id":"1266"},{"id":"1280"}],"height":150,"left":[{"id":"1263"}],"renderers":[{"id":"1278"}],"sizing_mode":"stretch_both","title":{"id":"1250"},"toolbar":{"id":"1270"},"toolbar_location":"above","x_range":{"id":"1215"},"x_scale":{"id":"1255"},"y_range":{"id":"1253"},"y_scale":{"id":"1257"}},"id":"1249","s
